import React, { } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useHistory
} from "react-router-dom";

function App() {

  return (


    <Router className="App">
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">ContentData</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>


  );
}


function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  let history = useHistory();

  function handleClick() {
    history.push("/home");
  }
  return (
    <div>
      <h2>Users</h2>
      <button type="button" onClick={handleClick}>
        Go home
    </button>
    </div>
  );
}

export default App;
